import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
      <Link to="/add-task">Add Task</Link>
      <Link to="/report-issue">Report Issue</Link>
      <Link to="/task-list">Task List</Link>
    </div>
  );
};

export default Dashboard;
